import React from "react";
import classNames from "classnames";
import { Container as _Container } from "reactstrap";


export const Container = ({ children, ...props }) => {
	return (
		<_Container className={ classNames("d-flex", "flex-column") } { ...props }>
			{ children }
		</_Container>
	)
}
